import React from 'react';

const Following = ({ followingList }) => {
    return (
        <div>
            <h3>Following</h3>
            <ul>
                {followingList.map(user => (
                    <li key={user.userID}>
                        <span>{user.name}</span>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Following;
